import React, { useState } from 'react';
import axios from 'axios';
import '../styles/ContainerRegister.css'; // Ensure you create a corresponding CSS file
import { useNavigate } from 'react-router-dom';
import Icon from '../components/IconBlack'; 

export default function ContainerRegister() {

    const [formData, setFormData] = useState({
        fullName: '',
        email: '',
        companyName: '',
        password: '',
        confirmPassword: ''
    });

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        
        if(formData.fullName === ""){
            window.alert("Digite um nome")
        }

        if(formData.email === ""){
            window.alert("Digite um email")
        }

        if(formData.companyName === ""){
            window.alert("Digite uma companhia")
        }

        if(formData.password === ""){
            window.alert("Digite uma senha")
        }

        if(formData.confirmPassword !== formData.password){
            window.alert("Campos de senha diferentes")
        }

        const data = {
            novo_login: formData.email,
            nova_senha: formData.confirmPassword,
            novo_nome: formData.fullName,
            novo_porto: formData.companyName
        }

        try {
            const response = await axios.post('http://localhost:8000/api/registerUser',
                data,
                { headers: { "Content-Type": "application/x-www-form-urlencoded" } }
            );
            if (response.data["sucesso"] === 1) {
                window.alert("Usuário registrado com sucesso");
            } else {
                window.alert("Erro ao registrar usuário: " + response.data["erro"]);
            }
        } catch (error) {
            console.error("Erro na requisição:", error);
            window.alert("Erro na comunicação com o servidor: " + error.message);
        }

    };

    return (
        <div className="port-registry-page">
            <Header />
            <div className="content">
            <form onSubmit={handleSubmit}>
                    <TextInput
                        label="Full name"
                        name="fullName"
                        value={formData.fullName}
                        onChange={handleChange}
                    />
                    <TextInput
                        label="Email"
                        name="email"
                        type="email"
                        value={formData.email}
                        onChange={handleChange}
                    />
                    <TextInput
                        label="Company name"
                        name="companyName"
                        value={formData.companyName}
                        onChange={handleChange}
                    />
                    <p className="terms-text">
                        By clicking Continue, you agree to our Terms and Conditions, and confirm you have read our Privacy Policy.
                    </p>
                    <button type="submit" className="signup-button">Sign up</button>
                </form>
                <div className="form-section">
                    <h2>Register a Container</h2>
                    <form className="port-form" onSubmit={handleSubmit}>
                        <input type="text" placeholder="Container ID" />
                        <input type="text" placeholder="Container Type" />
                        <input type="text" placeholder="Location" />
                        <input type="text" placeholder="Ship" />
                        <input type="text" placeholder="flag" />
                        <button type="submit">Register new Port</button>
                    </form>
                </div>
            </div>
        </div>
    );
}

function TextInput({ label, name, type = "text", value, onChange }) {
    return (
        <div className="input-group">
            <label>{label}*</label>
            <input
                type={type}
                name={name}
                value={value}
                onChange={onChange}
                required
            />
        </div>
    );
}

function Header() {
    const navigate = useNavigate();

    const handleNavigate = () => {
        navigate('/home');
    };
    return (
        <header className="navbar">
            <div className="logo">
                <Icon />
                <span>MyPort Manager</span>
            </div>
            <nav className="nav-links">
                <GoBackButton onClick={handleNavigate} />
            </nav>
        </header>
    );
}

function GoBackButton({ onClick }) {
    return (
        <button 
            className="sign-in-button" 
            onClick={onClick} 
            style={{ 
                color: 'white', 
                padding: '5px 10px',  // Adjust padding to make the button smaller
                width: '100%',         // Reduce width to 50%
                height: 'auto'        // Ensure height is adjusted accordingly
            }}
        >
            Home
        </button>
    );
}
